Filtering documents by objects in an array<p>I have an array of strings in my schema, and I'm trying to filter documents depending on their arrays containing certain strings or not. Below is my schema, where the ingredients array is what I'm trying to filter by:</p>

<pre><code>const foodSchema = mongoose.Schema({
  name: {
    type: String,
    required: true,
    trim: true,
  },
  ingredients: [
    {
      type: String,
      required: true,
      trim: true,
    },
  ],
});
</code></pre>

<p>In nodejs, I have the following inside my express router:</p>

<pre><code>router.get('/food', auth, async (req, res) =&gt; {
  const match = {};

  if (req.query.name) {
    match.name = req.query.name;
  }

  if (req.query.ingredients) {
    match.ingredients = req.query.ingredients;
  }

  try {
    const allFood = await Food.find(match);
    res.send({
      allFood,
    });
  } catch (error) {
    res.status(400).send(error);
  }
});
</code></pre>

<p>Here's an example request being sent:</p>

<pre><code>{{url}}/food?ingredients=Salmon Meal&amp;ingredients=Deboned Turkey
</code></pre>

<p>I would expect to get all food documents where their ingredients array contain both Salmon Meal and Deboned Turkey, but I always get an empty array. The casing is correct. If I just use one ingredient in the query, it works fine.</p>

