How to speed up $gt cursor on indexed field in MongoDB?<p><strong>Use Case:</strong> Go through an entire collection, sorted by a key, to make computations. Since the run time is long, we are running it multiple times, carrying forward using <code>$gt</code> on the key.</p>

<p><strong>Query</strong>
Below is a log entry from a cursor on a query like below:</p>

<pre><code>{ mpn_alnum: { "$gt" : "ABCD" } }
</code></pre>

<p><strong>Log Output</strong></p>

<p>Formatted for readability on Stack Overflow:</p>

<pre><code>command iodparts.searches command: 
  getMore {
    getMore: 259896659504,
    collection: "searches",
    $db: "iodparts",
    lsid: {
        id: UUID("XXXXXXXXXX")
    }
  }
  originatingCommand: {
    find: "searches",
    filter: {
        mpn_alnum: {
            $gt: "8051"
        }
    },
    sort: {
        mpn_alnum: 1
    },
    $db: "iodparts",
    lsid: {
        id: UUID("XXXXXXX")
    }
  }
  planSummary: IXSCAN {
    mpn_alnum: 1
  }
  cursorid: XXXXXXXX keysExamined: 184421 docsExamined: 184421 numYields: 2694 nreturned: 184420 reslen: 16777182 locks: {
    Global: {
        acquireCount: {
            r: 5390
        }
    },
    Database: {
        acquireCount: {
            r: 2695
        }
    },
    Collection: {
        acquireCount: {
            r: 2695
        }
    }
  }
  protocol:op_msg 49796ms
</code></pre>

<ol>
<li>The highest number of documents for the same <code>mpn_alnum</code> is 5000. Typically, they are less than 1000.</li>
<li>The number of documents in search collection is 27 million.</li>
</ol>

<p><strong>Question</strong>
This is taking 50-60 seconds each time to retrieve. Is there a way to improve the logic or speed up the operation?</p>

<p><strong>Update 1</strong></p>

<p>Clarifications:</p>

<p>"running it multiple times" means both: (a) fetched results from cursor for a few minutes. saved the last value of the returned field. (b) In the next query, picked up from where left, using $gt query. This one seems to take quite longer. The log output is output of getMore operation on one such query.</p>

<p>MongoDB Version: 3.6</p>

<p>WiredTiger is the engine.</p>

<p><strong>Update 2</strong></p>

<p>I used three different strategies that helped me get out of this issue.</p>

<p>A. Upgraded from MongoDB 3.6 to MongoDB 4.0</p>

<p>B. Doubled SDD Size and IOPS (I/O Operations per Second) - as per AWS EC2 standards - from 200 GB to 400 GB. The database was nearing 190+ GB.</p>

<p>C. Rewrote programming code from PHP 7 to NodeJS</p>

<p>Now, all the operations are under 1s. So its nearly 50X gain!</p>

