Project entire document from mongo by max created date time<p>I have created this query to get all documents within a certain date time frame by their max creation date time. I am looking for a list of all the latest documents for each hour.</p>

<pre class="lang-py prettyprint-override"><code>pipe = [
  {
    "$addFields": {
      "start": {
        "$dateFromString": {
          "dateString": "$StartTime",
          "format": "%Y-%m-%dT%H:%M:%S%z"
        }
      },
      "created": {
        "$dateFromString": {
          "dateString": "$CreatedDateTime",
          "format": "%Y-%m-%dT%H:%M:%S%z"
        }
      }
    }
  },
  {
    "$match": {
      "start": {
        "$gte": start_time,
        "$lte": end_time
      }
    }
  },
  {
    "$sort": {
      "created": -1
    }
  },
  {
    "$group": {
      "_id": "$start",
      "doc": {
        "$first": "$$ROOT"
      }
    }
  },
  {
    "$replaceRoot": {
      "newRoot": "$doc"
    }
  }
]
cursor = COLLECTION.aggregate(pipeline=pipe)
</code></pre>

<p>However since I am using <code>$addFields</code> I am also projecting <code>start</code> and <code>created</code> which I am not looking for. Can I replicate this query in a way to exclude those fields and only include the original document. I am also wondering if maybe this isn't the most optimal query for my solution so any input or suggestions are welcome.</p>

<p>This is a sample document:</p>

<pre><code>{
  "StartTime" : "2020-05-01T00:00:00-05:00",
  "EndTime" : "2020-05-01T00:59:59-05:00",
  "Value" : 100,
  "CreatedDateTime" : "2020-05-01T00:00:00-05:00"
}
</code></pre>

<p>This is what the query returns if i were to query for say one hour:</p>

<pre><code>{
  "StartTime" : "2020-05-01T00:00:00-05:00",
  "EndTime" : "2020-05-01T00:59:59-05:00",
  "Value" : 100,
  "CreatedDateTime" : "2020-05-01T00:00:00-05:00",
  "start" : datetime.datetime(2020,05,01),
  "created" : datetime.datetime(2020,05,01)
}
</code></pre>

<p>The result I am looking for is the sample document or a list of sample documents if I were to query for multiple hours.</p>

